8 способов скинуть лишние кг перед весной👌

Я, конечно, не претендую на звание диетолога или тренера😄 Просто поделюсь своими наблюдениями, исходя из опыта💪

Итак, поехали...
💥
1. Уберите из своего рациона майонез😲 Это оооочень жирный продукт, который за один приём пищи может перекрыть суточную норму жиров;

2. Исключите колбасу и сосиски🤞🏻Как и в первом пункте, в составе большое количество жиров, порой непонятного происхождения. Сейчас в любом магазине можно найти ветчину из индейки - отличная замена;

3. Конечно же, нужно ограничить сладкое... а если очень хочется (как мне😁), просто кушайте в небольшом количестве по утрам;

4.  Замените подсолнечное масло на оливковое. Если что-то жарите не наливайте много масла, просто распределите небольшое количество по сковороде с помощью специальной кисточки;

5. Замените белый и серый хлеб на ржаной или цельнозерновой либо на хлебцы;

6. Пейте воду вместо газировки и сока;

7. Добавьте активности: ходите по лестнице вместо лифта, во время просмотра фильма - встаньте и поприседайте, уделите 10 минуточек зарядке;

8. Не отказывайтесь от еды после 18 часов...просто отдайте предпочтение белковой пище и овощам.

И не морите себя голодом...к хорошему это не приведет🤗

Кто помнит меня такой, как на втором фото??? 2013 год... я недавно закончила универ🧐
